import {Link} from "react-router-dom";
import "./NavBar.css";
import mode from './images/Moon.png'
import profileImage from './images/Profile.png';
export function NavBar(){

    return(<nav>
                    <div className="nav-left-container">
                        <Link to="/" className="nav-link">Home</Link>
                    </div>
                    <div className="nav-right-container">
                        <Link to="/communities" className="nav-link">community</Link>
                        <Link to="/resume-builder" className="nav-link">resume builder</Link>
                        <Link to="/resources" className="nav-link">resources</Link>
                        <img src={mode} alt="mode switching" className="mode-icon" style={{ width: "24px", height: "24px"}}/>
                        <img src={profileImage} alt="profile" className="profile-pic" style={{ width: "48px", height: "48px"}}/>
                    </div>
            </nav>);
}
